import { Container, Logo, Typography } from "@toptal/picasso";

import * as S from "./styles";

const Nav = () => {
  return (
    <Container flex padded={0.5} justifyContent="center" style={S.navContainer}>
      <Container flex alignItems="center" gap={0.75}>
        <Logo variant="white" />
        <Typography color="inherit" style={S.navTypo}>
          Top heroes
        </Typography>
      </Container>
    </Container>
  );
};

export default Nav;
